import { Routes } from '@angular/router';

export const routes: Routes = [
  {
    path: '',
    loadChildren: () => import('./tabs/tabs.routes').then((m) => m.routes),
  },
  {
    path: 'preview',
    loadComponent: () => import('./preview/preview.page').then( m => m.PreviewPage)
  },
];
